// -------------------- Import --------------------
import Axios from "axios";
import React from "react";

// -------------------- Row Favorites Table --------------------
export default function RowFavoritesTable(props) {
  console.log(props.item.PLAYER_ID);
  return (
    <tr>
      <td>
        {props.item.PLAYER_ID ? (
          <img
            src={`https://cdn.nba.com/headshots/nba/latest/260x190/${props.item.PLAYER_ID}.png`}
            alt=""
          />
        ) : (
          <img
            src="https://ak-static.cms.nba.com/wp-content/uploads/logos/leagues/logo-gleague.svg"
            alt=""
          />
        )}
      </td>
      {/* Name */}
      <td>{props.item.PLAYER_NAME || props.item.TEAM_CITY}</td>
      {/* Number */}
      <td>{props.item.PTS || props.item.FT_PCT || props.item.FG3_PCT}</td>
      {/* Delete */}
      <td>
        <button onClick={() => props.deleteItem(props.item._id)}>remove</button>
      </td>
    </tr>
  );
}
